var Rosters=function(a){this.rosters=a;this.getEligibleRosters=function(b){var c=this.rosters;c=_.filter(c,function(d){return _.contains(d.gameIds,b*1)});return c};this.getTotalRosterEntriesCount=function(d){var e=this.rosters;var c=0;for(var b=0;b<e.length;b++){if(e[b].rosterId!=d){continue}c=e[b].entryCount;break}return c};this.getTotalEntriesCount=function(c){var d=this.rosters;var b=0;_.each(d,function(e){_.each(e.entries,function(f){if(f.tableId==c){b+=f.count}})});return b};this.getEntriesCount=function(c,b){var e=this.rosters;var d=0;_.each(e,function(f){if(f.rosterId!=c){return}_.each(f.entries,function(g){if(g.tableId!=b){return}d=g.count})});return d};this.addEntry=function(e,d){var g=this.rosters;var f=false;for(var c=0;c<g.length;c++){if(g[c].rosterId!=e){continue}for(var b=0;b<g[c].entries.length;b++){if(g[c].entries[b].tableId==d){g[c].entries[b].count+=1;g[c].entryCount=g[c].entryCount+1;f=true;break}}if(!f){g[c].entries.push({tableId:d,count:1});g[c].entryCount=g[c].entryCount?g[c].entryCount+1:1}}this.rosters=g}};